    # Initialize a hash table to store the count of all elements
    count = {}
    for i in range(n):
        count[arr[i]] = 1

    # Initialize result
    max_count = 0

    # Traverse the array and increment count
    # of every element in hash table
    for i in range(n):
        if count[arr[i]] == 1:
            # If this element is the first (or only) occurrence,
            # then increment count of all elements in range
            # (arr[i] to arr[i] + arr[i])
            for j in range(arr[i], arr[i] + arr[i]):
